import { Children } from "react";
import { useScroll } from '../components/hooks'

export function Parallax({children}) {
    const currentScroll = useScroll();
    return (
        <div>
            {children}
            <style jsx>{`
                div {
                    transform: translate3d(0,0,0);
                    margin-top: ${-currentScroll / 3}px;
                }
            `}</style>
        </div>
    )
}
